('2018-06-16', '03:18:00', '04:48:00', '13:15:00', '17:34:00', '21:30:00', '22:50:00', '00:00:00', 'بُنِيَ الْإِسْلَامُ عَلَى خَمْسٍ: شَهَادَةِ أَنْ لَا إلَهَ إلَّا اللَّهُ وَأَنَّ مُحَمَّدًا رَسُولُ اللَّهِ، وَإِقَامِ الصَّلَاةِ، وَإِيتَاءِ الزَّكَاةِ، وَحَجِّ الْبَيْتِ، وَصَوْمِ رَمَضَانَ', 'Islam has been built on five [pillars]: testifying that there is no deity worthy of worship except Allah and that Muhammad is the Messenger of Allah, establishing the salah (prayer), paying the zakat (obligatory charity), making the hajj (pilgrimage) to the House, and fasting in Ramadhan', 'فطور جماعي بعد صلاة الفجر يوم الاحد', '00:00:00', 'Hadith', 'َBreakfast together after Fajer on Sunday'),
('2018-06-17', '03:18:00', '04:48:00', '13:16:00', '17:34:00', '21:30:00', '22:50:00', '00:00:00', 'الدِّينُ النَّصِيحَةُ.\" قُلْنَا: لِمَنْ؟ قَالَ: \"لِلَّهِ، وَلِكِتَابِهِ، وَلِرَسُولِهِ، وَلِأَئِمَّةِ الْمُسْلِمِينَ وَعَامَّتِهِمْ', 'The deen (religion) is naseehah (advice, sincerity).” We said, “To whom?” He (ﷺ) said, “To Allah, His Book, His Messenger, and to the leaders of the Muslims and their common folk', '', '00:00:00', 'Hadith', NULL),
('2018-06-18', '03:19:00', '04:49:00', '13:16:00', '17:34:00', '21:30:00', '22:50:00', '00:00:00', 'وماتوفيقي الا بالله', 'My Success is only by Allah', '', '00:00:00', 'Quran', NULL),
('2018-06-19', '03:19:00', '04:49:00', '13:16:00', '17:34:00', '21:31:00', '22:51:00', '00:00:00', 'مَنْ مَاتَ وَهُوَ يَعْلَمُ أَنَّهُ لاَ إِلَهَ إِلاَّ اللَّهُ دَخَلَ الْجَنَّةَ', 'He who died knowing (fully well) that there is no god but Allah entered Paradise', '', '00:00:00', 'Hadith', NULL),
('2018-06-20', '03:19:00', '04:49:00', '13:16:00', '17:35:00', '21:31:00', '22:51:00', '00:00:00', 'إنَّ اللَّهَ كَتَبَ الْإِحْسَانَ عَلَى كُلِّ شَيْءٍ، فَإِذَا قَتَلْتُمْ فَأَحْسِنُوا الْقِتْلَةَ، وَإِذَا ذَبَحْتُمْ فَأَحْسِنُوا الذِّبْحَةَ، وَلْيُحِدَّ أَحَدُكُمْ شَفْرَتَهُ، وَلْيُرِحْ ذَبِيحَتَهُ', 'Verily Allah has prescribed ihsan (proficiency, perfection) in all things. So if you kill then kill well; and if you slaughter, then slaughter well. Let each one of you sharpen his blade and let him spare suffering to the animal he slaughters', '', '00:00:00', 'Hadith', NULL),
('2018-06-21', '03:19:00', '04:49:00', '13:17:00', '17:35:00', '21:31:00', '22:51:00', '00:00:00', 'اتَّقِ اللَّهَ حَيْثُمَا كُنْت، وَأَتْبِعْ السَّيِّئَةَ الْحَسَنَةَ تَمْحُهَا، وَخَالِقْ النَّاسَ بِخُلُقٍ حَسَنٍ', 'Have taqwa (fear) of Allah wherever you may be, and follow up a bad deed with a good deed which will wipe it out, and behave well towards the people. It was related by at-Tirmidhi, who said it was a hasan (good) hadeeth', '', '00:00:00', 'Hadith', NULL),
('2018-06-22', '03:19:00', '04:49:00', '13:17:00', '17:35:00', '21:31:00', '22:51:00', '00:00:00', 'يَا رَسُولَ اللَّهِ! قُلْ لِي فِي الْإِسْلَامِ قَوْلًا لَا أَسْأَلُ عَنْهُ أَحَدًا غَيْرَك؛ قَالَ: قُلْ: آمَنْت بِاَللَّهِ ثُمَّ اسْتَقِمْ', 'I said, \"O Messenger of Allah, tell me something about al-Islam which I can ask of no one but you.\" He (peace and blessings of Allah be upon him) said, \"Say I believe in Allah — and then be steadfast.', '', '00:00:00', 'Hadith', NULL),
('2018-06-23', '03:19:00', '04:49:00', '13:17:00', '17:35:00', '21:32:00', '22:52:00', '00:00:00', 'أَنَّ رَجُلًا سَأَلَ رَسُولَ اللَّهِ صلى الله عليه و سلم فَقَالَ: أَرَأَيْت إذَا صَلَّيْت الْمَكْتُوبَاتِ، وَصُمْت رَمَضَانَ، وَأَحْلَلْت الْحَلَالَ، وَحَرَّمْت الْحَرَامَ، وَلَمْ أَزِدْ عَلَى ذَلِكَ شَيْئًا؛ أَأَدْخُلُ الْجَنَّةَ؟ قَالَ: نَعَمْ', 'A man questioned the Messenger of Allah (peace and blessings of Allah be upon him) and said, “Do you think that if I perform the obligatory prayers, fast in Ramadhan, treat as lawful that which is halal, and treat as forbidden that which is haram, and do not increase upon that [in voluntary good deeds], then I shall enter Paradise?” He (peace and blessings of Allah be upon him) replied, “Yes.”', '', '00:00:00', NULL, NULL),
('2018-06-24', '03:20:00', '04:50:00', '13:17:00', '17:36:00', '21:32:00', '22:52:00', '00:00:00', 'لَا يُؤْمِنُ أَحَدُكُمْ حَتَّى يَكُونَ هَوَاهُ تَبَعًا لِمَا جِئْتُ بِهِ', 'The Messenger of Allah (peace and blessings of Allah be upon him) said, “None of you [truly] believes until his desires are subservient to that which I have brought.” [Imam an-Nawawi says:] We have related it in Kitab al-Hujjah with a saheeh chain of narrators.', '', '00:00:00', 'Hadith', NULL),
('2018-06-25', '03:20:00', '04:50:00', '13:17:00', '17:36:00', '21:32:00', '22:52:00', '00:00:00', 'فَلَا تَغُرَّنَّكُمُ الْحَيَاةُ الدُّنْيَا', 'So let not this present life deceive you', '', '00:00:00', 'Hadith', NULL),
('2018-06-26', '03:21:00', '04:51:00', '13:18:00', '17:36:00', '21:32:00', '22:52:00', '00:00:00', ' فَإِنَّ مَعَ الْعُسْرِ يُسْرًا (5) إِنَّ مَعَ الْعُسْرِ يُسْرًا ', 'So verily with the hardship there is relief, verily with the hardship there is relief', '', '00:00:00', 'َQuran', NULL),
('2018-06-27', '03:21:00', '04:51:00', '13:18:00', '17:36:00', '21:31:00', '22:51:00', '00:00:00', '‏اتقوا النار ولو بشق تمرة فمن لم يجد فبكلمة طيبة', 'Guard yourselves against the Fire (of Hell) even if it be only with half a date-fruit (given in charity); and if you cannot afford even that, you should at least say a good word', '', '00:00:00', 'Hadith', NULL),
('2018-06-28', '03:21:00', '04:51:00', '13:18:00', '17:36:00', '21:31:00', '22:51:00', '00:00:00', 'والكلمة الطيبة صدقة', 'It is also charity to utter a good word', '', '00:00:00', 'Hadith', NULL),
('2018-06-29', '03:22:00', '04:52:00', '13:18:00', '17:36:00', '21:31:00', '22:51:00', '00:00:00', 'فَاصْبِرْ إِنَّ وَعْدَ اللَّهِ حَقٌّ', 'So be patient. Indeed, the promise of ALLAH is truth', '', '00:00:00', 'Quran', NULL),
('2018-06-30', '03:23:00', '04:53:00', '13:18:00', '17:36:00', '21:31:00', '22:51:00', '00:00:00', 'وَمَنْ يَتَّقِ اللَّهَ يَجْعَلْ لَهُ مِنْ أَمْرِهِ يُسْراً ', 'And for those who fear Allah, he will make their path easy', '', '00:00:00', 'Quran', NULL),
('2018-07-01', '03:23:00', '04:53:00', '13:19:00', '17:36:00', '21:31:00', '22:51:00', '00:00:00', ' لَمَّا قَضَى اللَّهُ الْخَلْقَ، كَتَبَ فِي كِتَابِهِ عَلَى نَفْسِهِ، فَهُوَ مَوْضُوعٌ عِنْدَهُ: إِنَّ رَحْمَتِي تَغْلِبُ غَضَبِي', 'When Allah decreed the Creation He pledged Himself by writing in His book which is laid down with Him: My mercy prevails over my wrath', '', '00:00:00', 'Hadith', NULL),
('2018-07-02', '03:24:00', '04:54:00', '13:19:00', '17:36:00', '21:30:00', '22:50:00', '00:00:00', 'قَالَ اللَّهُ تَبَارَكَ وَتَعَالَى: أَنَا أَغْنَى الشُّرَكَاءِ عَنْ الشِّرْكِ؛ مَنْ عَمِلَ عَمَلًا أَشْرَكَ مَعِي غَيْرِي(1)، تَرَكْتُهُ وَشِرْكَهُ', 'Allah (glorified and exalted be He) said: I am so self-sufficient that I am in no need of having an associate. Thus he who does an action for someone else\'s sake as well as Mine will have that action renounced by Me to him whom he associated with Me', '', '00:00:00', 'Hadith', NULL),
('2018-07-03', '03:25:00', '04:55:00', '13:19:00', '17:36:00', '21:30:00', '22:50:00', '00:00:00', 'ادْعُ إِلَىٰ سَبِيلِ رَبِّكَ بِالْحِكْمَةِ وَالْمَوْعِظَةِ الْحَسَنَةِ ۖ وَجَادِلْهُم بِالَّتِي هِيَ أَحْسَنُ ۚ إِنَّ رَبَّكَ هُوَ أَعْلَمُ بِمَن ضَلَّ عَن سَبِيلِهِ ۖ وَهُوَ أَعْلَمُ بِالْمُهْتَدِينَ', 'Invite to the way of your Lord with wisdom and good instruction, and argue with them in a way that is best. Indeed, your Lord is most knowing of who has strayed from His way, and He is most knowing of who is [rightly] guided', '', '00:00:00', 'Quran', NULL),
('2018-07-04', '03:25:00', '04:55:00', '13:19:00', '17:36:00', '21:30:00', '22:50:00', '00:00:00', ' يَعْجَبُ رَبُّكَ مِنْ رَاعِي غَنَمٍ، فِي رَأْسِ شَظِيَّةِ الْجَبَلِ(1)، يُؤَذِّنُ بِالصَّلَاةِ وَيُصَلِّي، فَيَقُولُ اللَّهُ، عَزَّ وَجَلَّ: انْظُرُوا إِلَى عَبْدِي هَذَا، يُؤَذِّنُ وَيُقِيمُ الصَّلَاةَ، يَخَافُ مِنِّي، قَدْ غَفَرْتُ لِعَبْدِي، وَأَدْخَلْتُهُ الْجَنَّةَ', 'I heard the messenger of Allah (ﷺ) say: Your Lord delights at a shepherd who, on the peak of a mountain crag, gives the call to prayer and prays. Then Allah (glorified and exalted be He) say: Look at this servant of Mine, he gives the call to prayer and performs the prayers; he is in awe of Me. I have forgiven My servant [his sins] and have admitted him to Paradise', '', '00:00:00', 'Hadith', NULL),
('2018-07-05', '03:26:00', '04:56:00', '13:19:00', '17:36:00', '21:29:00', '22:49:00', '00:00:00', ' إِنَّ اللَّهَ يُوصِيكُمْ بِأُمَّهَاتِكُمْ - ثَلاَثًا - إِنَّ اللَّهَ يُوصِيكُمْ بِآبَائِكُمْ إِنَّ اللَّهَ يُوصِيكُمْ بِالأَقْرَبِ فَالأَقْرَبِ', 'Allah\'s Messenger said: \"Allah enjoins you to treat your mother\'s kindly\"-three times- \"Allah enjoins you to treat your fathers kindly, Allah enjoins you to treat the closest and the next closest kindly', '', '00:00:00', 'Hadith', NULL),
('2018-07-06', '03:27:00', '04:57:00', '13:20:00', '17:36:00', '21:29:00', '22:49:00', '00:00:00', 'رَبَّنَا اغْفِرْ لِي وَلِوَالِدَيَّ وَلِلْمُؤْمِنِينَ يَوْمَ يَقُومُ الْحِسَابُ ', 'Our Lord, forgive me and my parents and the believers the Day the account is established', '', '00:00:00', 'Quran', NULL),
('2018-07-07', '03:28:00', '04:58:00', '13:20:00', '17:36:00', '21:28:00', '22:48:00', '00:00:00', 'مَا مِنْ رَجُلٍ تُدْرِكُ لَهُ ابْنَتَانِ فَيُحْسِنُ إِلَيْهِمَا مَا صَحِبَتَاهُ أَوْ صَحِبَهُمَا إِلاَّ أَدْخَلَتَاهُ الْجَنَّةَ ', 'There is no man whose two daughters reach the age of puberty and he treats them kindly for the time they are together, but they will gain him admittance to Paradise', '', '00:00:00', 'Hadith', NULL),
('2018-07-08', '03:29:00', '04:59:00', '13:20:00', '17:36:00', '21:27:00', '22:47:00', '00:00:00', 'مَنْ كَانَ يُؤْمِنُ بِاللَّهِ وَالْيَوْمِ الآخِرِ فَلْيُحْسِنْ إِلَى جَارِهِ وَمَنْ كَانَ يُؤْمِنُ بِاللَّهِ وَالْيَوْمِ الآخِرِ فَلْيُكْرِمْ ضَيْفَهُ وَمَنْ كَانَ يُؤْمِنُ بِاللَّهِ وَالْيَوْمِ الآخِرِ فَلْيَقُلْ خَيْرًا أَوْ لِيَسْكُتْ', 'Whoever believes in the Last Day, let him treat his neighbour well. Whoever believes in Allah and Last Day, let him honor his guest. Whoever believes in Allah and the Last Day, let him say something good or else remain silent', '', '00:00:00', 'Hadith', NULL),
('2018-07-09', '03:30:00', '05:00:00', '13:20:00', '17:36:00', '21:27:00', '22:47:00', '00:00:00', 'قَالَ وَمَن يَقْنَطُ مِن رَّحْمَةِ رَبِّهِ إِلَّا الضَّالُّونَ', 'He said, \"And who despairs of the mercy of his Lord except for those astray?', '', '00:00:00', 'Quran', NULL),
('2018-07-10', '03:31:00', '05:01:00', '13:20:00', '17:36:00', '21:26:00', '22:46:00', '00:00:00', 'وَاللَّـهُ يَعْلَمُ مَا تُسِرُّونَ وَمَا تُعْلِنُونَ', 'And Allah knows what you conceal and what you declare', '', '00:00:00', 'Quran', NULL),
